import logo from '../images/logo.svg';
import ToggleButton from 'react-toggle-button';



function Nav() {

    return (
      <nav>
        <div>
          <img src={logo} alt="logo" className="logo"/>
        </div>
        <div>
          <ToggleButton/>
        </div>
      </nav>
    );


}

export default Nav;
